import Navbar from './navbar'


const layout = (props)=>(
    <div>
        
        <head>
            <title>the brongondyte</title>
            <link rel="stylesheet" href="components\style\styler.css"/>
        </head>
        <Navbar/>
        {props.children}
    </div>
)


export default layout;
